import './TabButton.css'

export default function TabButtons(props) {
    return (
        <div id="tabButtonDiv">
            <button onClick={handleClick}>{props.children}</button>
            <div id="dataContent">
            </div>
        </div>
    )
}

function handleClick() {
    const div = document.getElementById('dataContent');

    div.style.display = 'block';
}
